description:
Category	Feature, Plot Based, Parody / Spoof, Female Producers/Directors

Director	Bonnie Rotten
Starring	Bonnie Rotten, Evan Stone, Chanel Preston, Alec Knight, Tommy Pistol, Jodi Taylor, Luna Star, Jordan Septo, Jimmy Broadway, Jack Spade

After being released from her wrongful incarceration, Maxine Cady (Bonnie Rotten) is out for revenge. Convinced her lawyer, Samantha Bowden (Chanel Preston), is to blame, she focuses her terrorizing rampage on her and her family. As this thrilling, erotic take keeps you on the edge of your seat, you're left wondering whether you should root for Samantha or Max... Whose side are you on?

